// components/navbar.js
import React from 'react';
import { NavLink } from 'react-router-dom';

function Navbar() {
  return (
    <nav>
      <NavLink exact to={'/'} id='glass'>Home</NavLink>
      <NavLink to={'/buns'}>Buns</NavLink>
    </nav>
  );
}

export default Navbar;
